import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
const CourseList = () => {
	const type = 'teacher';
	const data = [
		{
			kurs: 'cloud computing',
		},
		{
			kurs: 'bulut bilişim',
		},
	];
	const columns = [
		{
			title: 'Course',
			dataIndex: 'kurs',
		},
		{
			title: 'Actions',
			render: () => {
				<Space size='middle'>
					<Link>
						<div>add student</div>
					</Link>
					<Link>
						<a>create exam</a>
					</Link>
				</Space>;
			},
		},
	];
	return <Table dataSource={data} columns={columns} />;
};
export default CourseList;
